import React, { useRef } from "react";
import { useGLTF, OrbitControls } from "@react-three/drei";
import {Canvas} from "@react-three/fiber"


const shapes = require("../../assets/3dModels/backgroundShapes.gltf")

export function Model(props) {
    const { nodes, materials } = useGLTF(shapes);
    return (
        <group {...props} dispose={null}>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001.geometry}
        material={materials["Material.002"]}
        position={[-1.59, 0.8, -0.09]}
        rotation={[-0.26, 0.43, 0.58]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple002.geometry}
        material={materials["Material.003"]}
        position={[1.68, 0.22, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.blockBlue.geometry}
        material={materials["Material.002"]}
        position={[-0.96, -0.59, -0.72]}
        rotation={[-0.31, 0.09, 0.68]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramidPurple.geometry}
        material={materials["Material.003"]}
        position={[-2.08, 0.7, -0.49]}
        rotation={[-0.27, 0.44, 0.58]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple.geometry}
        material={materials["Material.003"]}
        position={[0.23, 0.5, -0.28]}
        rotation={[2.28, -0.63, 2.04]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePiunk.geometry}
        material={materials["Material.004"]}
        position={[0.4, 0.85, -0.12]}
        rotation={[2.28, -0.63, 2.04]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple002002.geometry}
        material={materials["Material.004"]}
        position={[-2.91, 0.46, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001002.geometry}
        material={materials["Material.004"]}
        position={[2.18, -0.84, -0.09]}
        rotation={[0.21, 0.45, -0.45]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001004.geometry}
        material={materials["Material.004"]}
        position={[-2.92, -0.69, -0.09]}
        rotation={[-0.46, -0.2, 1.96]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.blockBlue001.geometry}
        material={materials.Material}
        position={[-0.96, -0.59, -0.72]}
        rotation={[-0.31, 0.09, 0.68]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePiunk001.geometry}
        material={materials.Material}
        position={[0.4, 0.85, -0.12]}
        rotation={[2.28, -0.63, 2.04]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple001.geometry}
        material={materials.Material}
        position={[0.23, 0.5, -0.28]}
        rotation={[2.28, -0.63, 2.04]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple002001.geometry}
        material={materials.Material}
        position={[1.68, 0.22, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001001.geometry}
        material={materials.Material}
        position={[-1.59, 0.8, -0.09]}
        rotation={[-0.26, 0.43, 0.58]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramidPurple001.geometry}
        material={materials.Material}
        position={[-2.08, 0.7, -0.49]}
        rotation={[-0.27, 0.44, 0.58]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.BezierCurve.geometry}
        material={materials["Material.004"]}
        position={[-1.22, 0.48, 0]}
        rotation={[0, 0, 0.75]}
        scale={0.12}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.BezierCurve001.geometry}
        material={materials["Material.003"]}
        position={[-1.9, -0.54, 0]}
        rotation={[0, 0, -0.3]}
        scale={0.12}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.BezierCurve002.geometry}
        material={materials["Material.002"]}
        position={[0.95, -0.54, 0]}
        rotation={[0, 0, 0.75]}
        scale={0.33}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.cubePurple002003.geometry}
        material={materials.Material}
        position={[-2.91, 0.46, 0.51]}
        rotation={[0.14, -0.61, 0.24]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001003.geometry}
        material={materials.Material}
        position={[2.18, -0.84, -0.09]}
        rotation={[0.21, 0.45, -0.45]}
      />
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.pyramid001005.geometry}
        material={materials.Material}
        position={[-2.92, -0.69, -0.09]}
        rotation={[-0.46, -0.2, 1.96]}
      />
    </group>
  );
}

useGLTF.preload(shapes);

export default function BackgroundShapes() {

    return <div style={{ zIndex: "-1", position: "fixed", height: "100dvh", width: "100dvw", border: "2px solid red", pointerEvents: "none" }}>
        <Canvas>
        <OrbitControls enablePan={true} enableZoom={true} enableRotate={true} default={true} />
            <ambientLight />
            <pointLight position={[5, 5, 5]} />
            <Model />
        </Canvas>
    </div >
}
